import React from "react";
import { Container, AppBar, Typography, Grow, Grid, Box } from '@mui/material';

import Adventures from './images/Adventures.png';
import Posts from "./components/posts/posts";
import Form from "./components/form/form";
import useStyles from './styles'

const App = () => {
    const classes = useStyles();

    return(
        <Container maxidth="lg">
            <AppBar classNameposition="static" color="inherit">
                <Typography variant="h2" align="center">Adventures</Typography>
                <img src={Adventures} alt="advent" height="300" />
            </AppBar>
            <Grow in>
                <Container>
                    <Grid container justify = "space-between" alignItems= "stretch" spacing={3}>
                        <Grid item xs={12} sm={7}>
                            <Posts />
                        </Grid>
                        <Grid item xs={12} sm={4}>
                            <Form />
                        </Grid>
                    </Grid>
                </Container>
            </Grow>
        </Container>
    );
}

export default App;
